import React, { useCallback, useState } from "react"
import dynamic from "next/dynamic"
import { css } from "aphrodite/no-important"
import withApollo from "../lib/withApollo"
import baseStyle from '../styles'
import { Spin } from "../Components"
import { Locations } from "../types/locations"

type MainLayoutProps = {
  children: any
  title: string
  auth?: boolean
  header?: string
}
type MyGoogleMapsProps = {
  mapContainerStyle: { height: string, width: string }
  center: { lat: number, lng: number }
  zoom: number
  locations?: Locations
  disableDefaultUI: boolean
  click?: (event) => any
  search: boolean
  isType?: string | null
}

type clsProps = {
  latLng: {
    coordinateY: number,
    coordinateX: number
  } | null
  isTypeSelect: ( arg: string ) => void
}

const MainLayout = dynamic<MainLayoutProps>(() => import('../Components/MainLayout/MainLayout') as any, {
  loading: () => <Spin />
})

const GoogleMaps = dynamic<MyGoogleMapsProps>(() => import('../Containers/GoogleMaps/GoogleMaps') as any, {
  loading: () => <Spin />
})

const CreateLocationSelector = dynamic<clsProps>(() => import('../modules/CreateLocation/Containers/CreateLocationSelector') as any, {
  loading: () => <Spin />
})

const CreateLocation =() => {
  const [ latLng, setLatLnd ] = useState(null)
  const [ isType, setIsType ] = useState(null)
  const mapContainerStyle = { height: "calc(100vh - 200px)", width: '100%' }
  const center = { lat: 49.026151, lng: 31.483070 }
  const zoom = 6
  const click = useCallback((event) => {
    setLatLnd({
      coordinateY: event.latLng.lat(),
      coordinateX: event.latLng.lng()
    })
  }, [])
  const isTypeSelect = (isType: string) => {
    setIsType(isType)
  }
  return <MainLayout title={'Create Location'} header='Редагування'>
    <div className={ css(baseStyle.boxShadow, baseStyle.wrapperCreateLocation) }>
      <GoogleMaps mapContainerStyle={ mapContainerStyle } center={ center } zoom={ zoom } disableDefaultUI={ false } click={ click } search={ true } isType={ isType } />
      <CreateLocationSelector latLng={ latLng } isTypeSelect={ isTypeSelect } />
    </div>
  </MainLayout>
}

export default withApollo(CreateLocation)
